import React from 'react';
import { Link } from 'react-router-dom';
import '../css/Nav.css';

function Navbar() {
    return (
        <div className='navBar'>
            <div className='Home'>
                <Link to="/">Home</Link>
            </div>
            <div className='AboutUs'>
                <Link to="/about">About Us</Link>
            </div>
            <div className='ContactUs'>
                <Link to="/contact">Contact Us</Link>
            </div>
        </div>
    );
}

export default Navbar;
